import React, { Component } from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import { Security, SecureRoute, ImplicitCallback } from "@okta/okta-react";
import Navbar from "./features/navbar/Navbar";
import HomePage from "./features/pages/Home";
import Staff from "./features/pages/Staff";
import Login from "./features/auth/Login";
import "./App.css";

const config = {
  issuer: "https://dev-500578.oktapreview.com/oauth2/default",
  redirect_uri: window.location.origin + "/implicit/callback",
  client_id: "0oahrdfs7sxBGFkES0h7"
};

class App extends Component {
  onAuthRequired = ({ history }) => {
    history.push("/login");
  };
  render() {
    return (
      <Router>
        <Security
          issuer={config.issuer}
          client_id={config.client_id}
          redirect_uri={config.redirect_uri}
          onAuthRequired={this.onAuthRequired}
        >
          <div className="App">
            <Navbar />
            <div className="container">
              <Route path="/" exact={true} component={HomePage} />
              <SecureRoute path="/staff" exact={true} component={WebPortal} />
              <Route
                path="/login"
                render={() => (
                  <Login baseUrl="https://dev-500578.oktapreview.com" />
                )}
              />
              <Route path="/implicit/callback" component={ImplicitCallback} />
            </div>
          </div>
        </Security>
      </Router>
    );
  }
}

export default App;
